import HeaderImgLogo from '../assets/img/Group.png'
const HeaderJs  = [
    {
        navbar: [
            {
                id: 0,
                img: [
                    {
                        id: 0,
                        img: HeaderImgLogo
                    }
                ],
                navbarText: [
                    {

                        text: 'Главная'
                    },
                    {
                        text: 'Про гида'
                    },
                    {
                        text: 'Программа тура'
                    },
                    {
                        text: 'Стоимость'
                    },
                    {
                        text: 'Блог'
                    },
                    {
                        text: 'Контакты'
                    },
                ],
                navbarButtonText: [
                    {
                        buttonText: 'Консультация'
                    }
                ]
            }
        ]
    }
]
export default HeaderJs
